import React from 'react';
import ReturnValiDExchange from './ValidExchange';
import { auth } from '../firebase';
import { useNavigate } from 'react-router-dom';

// Return Transaction view
export default function ValidExchAngeUsd() {

 const navigation = useNavigate();
 const user = auth.currentUser;

 React.useEffect(() => {
  user != null ? window.console.log(true) : navigation('/');
 }, []);

 return (
  <ReturnValiDExchange />
 );
};
